window.onload=function(){var t=document.querySelector("._workers-row"),e=t.getAttribute("data-post-id"),o=t.getAttribute("data-offset"),r=t.getAttribute("data-nonce"),a=t.getAttribute("data-ajax-url");t.getAttribute("data-ajax-load-more");document.querySelector("._button").addEventListener("click",function(){jQuery.ajax({url:a,method:"post",dataType:"json",data:{action:"ajax_load_more",post_id:e,offset:o,nonce:r},beforeSend:function(){jQuery("._workers-loading").show()},success:function(t){jQuery("._workers-row").append(t.content),jQuery("._workers-loading").hide(),o=t.offset,t.more||jQuery("._button").css("display","none")},error:function(t,e,o){alert(t.status),alert(o)}})})};